import React from 'react';
import './App.css';
import Hero from './components/Hero/Hero';

let bannerData = {
  heading: 'Take a break and rejuvenate.'
}

function App() {
  return (
    <div className="App">
      <div id="Hero"></div>
    </div>
  );
}

ReactDOM.render(
  <Hero heading={bannerData.heading} />,
  document.getElementById('Hero')
);

export default App;
